                placeholder={placeholder}
                style={{
                    listStyle: 'none',
                    width: '300px',
                    padding: '5px',
                    borderLeft: 'none',
                    borderRight: 'none',
                    borderTop: 'none',
                }}
            />
              <ul>
                {players.map((player) => (
                    <li key={player}>{player}</li>
                ))}
            </ul>
        </>

    );
}

export default Input;
